import React from "react";
import companyLogo from "../../assets/logo-search-grid-1x.png";
export default function logo() {
  return (
    <div className="logo">
      <img  src={companyLogo} alt="BigCo Inc. logo" />
      <style>
        .logo{{
            height: 100,
            width: 100
        }}
      </style>
    </div>
  );
}
